import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from "react-router-dom";
import HomePage from "./pages/HomePage";
import AboutPage from "./pages/AboutPage";
import WorkPage from "./pages/WorkPage";
import PortfolioPage from "./pages/PortfolioPage";
import ContactPage from "./pages/ContactPage";
import InteractionDesignCase from "./pages/InteractionDesignCase";
import EventManagementCaseStudy from "./pages/EventManagementCaseStudy";
import STQM from "./pages/STQM";

import ParticlesBackground from "./components/ParticlesBackground";

// Responsive device hook
function useIsMobile(breakpoint = 600) {
  const [isMobile, setIsMobile] = React.useState(window.innerWidth < breakpoint);
  React.useEffect(() => {
    function handleResize() {
      setIsMobile(window.innerWidth < breakpoint);
    }
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, [breakpoint]);
  return isMobile;
}

// Mobile navbar overlay (dark theme)
function MobileNavMenu({ navs, location, open, setOpen }) {
  return (
    open && (
      <div style={{
        position: "fixed",
        top: 0,
        right: 0,
        width: "75vw",
        maxWidth: 360,
        height: "100vh",
        background: "#0d1117",
        boxShadow: "-6px 0 30px rgba(0,0,0,0.65)",
        zIndex: 999,
        paddingTop: 70,
        paddingBottom: 30,
        display: "flex",
        flexDirection: "column",
        alignItems: "flex-end",
        overflowY: "auto",
      }}>
        <button
          onClick={() => setOpen(false)}
          style={{
            background: "none",
            border: "none",
            color: "#7B9ACC",
            fontSize: 32,
            fontWeight: 900,
            marginRight: 28,
            marginTop: -60,
            marginBottom: 40,
            cursor: "pointer",
          }}
        >
          ×
        </button>
        {navs.map(({ to, label }) => (
          <Link
            key={to}
            to={to}
            onClick={() => setOpen(false)}
            style={{
              width: "100%",
              textAlign: "right",
              color: location.pathname === to ? "#a5d6ff" : "#c9d1d9",
              textDecoration: "none",
              padding: "18px 6vw",
              marginBottom: 6,
              fontWeight: location.pathname === to ? 900 : 700,
              fontSize: 17,
              opacity: location.pathname === to ? 1 : 0.92,
              background: location.pathname === to ? "rgba(123,154,204,0.12)" : "transparent",
            }}
          >
            {label}
          </Link>
        ))}
      </div>
    )
  );
}

// Navbar – tanpa background putih, transparan + blur ringan
function Navbar() {
  const location = useLocation();
  const isMobile = useIsMobile();
  const [showMenu, setShowMenu] = useState(false);
  const navs = [
    { to: "/", label: "Home" },
    { to: "/about", label: "About" },
    { to: "/work", label: "Work" },
    { to: "/portfolio", label: "Projects" },
    { to: "/contact", label: "Contact" }
  ];

  return (
    <>
      <nav style={{
        width: "100vw",
        background: isMobile ? "#0d1117" : "rgba(13, 17, 23, 0.68)",
        backdropFilter: isMobile ? "none" : "blur(14px)",
        boxShadow: isMobile ? "none" : "0 6px 32px rgba(0,0,0,0.4)",
        borderBottom: "1px solid rgba(48, 54, 61, 0.28)",
        padding: isMobile ? "14px 0" : "20px 0",
        display: "flex",
        justifyContent: isMobile ? "flex-end" : "center",
        alignItems: "center",
        position: "fixed",
        top: 0,
        left: 0,
        zIndex: 1000,
        gap: isMobile ? 0 : 52,
        fontWeight: 700,
        fontSize: isMobile ? 15 : 18,
      }}>
        {!isMobile && (
          <>
            {navs.map(({ to, label }) => (
              <Link
                key={to}
                to={to}
                style={{
                  color: location.pathname === to ? "#a5d6ff" : "#c9d1d9",
                  textDecoration: "none",
                  padding: "10px 20px",
                  borderRadius: 8,
                  background: "transparent",
                  fontWeight: location.pathname === to ? 900 : 700,
                  transition: "color 0.22s ease, transform 0.22s ease",
                  transform: location.pathname === to ? "scale(1.06)" : "scale(1)",
                }}
              >
                {label}
              </Link>
            ))}
          </>
        )}

        {isMobile && (
          <button
            onClick={() => setShowMenu(v => !v)}
            style={{
              background: "none",
              border: "none",
              fontSize: 34,
              fontWeight: 900,
              color: "#7B9ACC",
              marginRight: 24,
              cursor: "pointer",
              padding: 0,
              lineHeight: 1,
            }}
            aria-label="Open menu"
          >
            ☰
          </button>
        )}
      </nav>

      <MobileNavMenu navs={navs} location={location} open={isMobile && showMenu} setOpen={setShowMenu} />
    </>
  );
}

// Main App
export default function App() {
  return (
    <Router>
      {/* Particles background – tetap sharp, tanpa blur di layer ini */}
      <ParticlesBackground />

      {/* Wrapper konten utama – tanpa blur supaya partikel tetap tajam */}
      <div style={{
        position: "relative",
        zIndex: 1,
        minHeight: "100vh",
        background: "rgba(10, 14, 23, 0.48)",  // overlay gelap ringan untuk readability
        // backdropFilter dihapus agar partikel tidak blur
        paddingTop: "90px",                   // beri ruang untuk navbar fixed (sesuaikan jika navbar lebih tinggi/rendah)
      }}>
        <Navbar />

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<AboutPage />} />
          <Route path="/work" element={<WorkPage />} />
          <Route path="/portfolio" element={<PortfolioPage />} />
          <Route path="/contact" element={<ContactPage />} />
          <Route path="/interaction-design-case" element={<InteractionDesignCase />} />
          <Route path="/event-management-case-study" element={<EventManagementCaseStudy />} />
          <Route path="/stqm-case-study" element={<STQM />} />
        </Routes>
      </div>
    </Router>
  );
}
